void setup(void)
{
	// Initialize the TFT display
	tft.begin();
	tft.setRotation(3); // Set rotation if needed
	tft.fillScreen(ILI9341_BLACK); // Clear the screen

	// Initialize U8g2 with the TFT display
	u8g2.begin(tft);
	u8g2.setFont(u8g2_font_ncenB08_tr); // Set a font for U8g2

	pinMode(myTFT_ILI9341_TFT_RST_PIN_D2, OUTPUT);
	pinMode(myTFT_ILI9341_TFT_DC_PIN_D3, OUTPUT);
	pinMode(myTFT_ILI9341_TFT_SPI_PIN_CS_D53, OUTPUT);
	SPI.begin();
}

void loop(void)
{
	// Refresh output data
	updateOutputs(); 

	// Display a message on the TFT screen
	displayMessage("Hello, TFT Display!");
	delay(1000); // Delay for demonstration purposes
}

void updateOutputs()
{
	digitalWrite(myTFT_ILI9341_TFT_RST_PIN_D2, myTFT_ILI9341_TFT_RST_PIN_D2_rawData);
	digitalWrite(myTFT_ILI9341_TFT_DC_PIN_D3, myTFT_ILI9341_TFT_DC_PIN_D3_rawData);
}

