            for(int i = 0; minGradeNumber <= userRandomNumber; i++)
            {
                gradeCounter++;
                minGradeNumber *= degreeTwo;  
            }      

            Console.WriteLine($"Минимальная степень двойки, превосходящая {userRandomNumber}: 2^{gradeCounter} = {minGradeNumber}");
