using namespace std;
 
int main() {
    ios::sync_with_stdio(false);
    int n, d;
    cin >> n >> d;
    
    vector<pair<int, int>> v(n);
    for(int i = 0; i < n; i++) {
        cin >> v[i].second >> v[i].first;
    }
    sort(v.begin(), v.end());
    int res = 2e9;
    for(int i = 0; i < v.size(); i++) {
        for(int j = i + 1; j < v.size(); j++) {
            if(v[j].first - v[i].first >= d) {
                res = min(res, abs(v[j].second - v[i].second));
            }
        }
    }
    cout << res << endl;
    return 0;
}

function salaryFine(input) {
    let tabNums = Number(input[0]);
    let salary = Number(input[1]);


    for (let tab = 0; tab < tabNums; tab++) {

        let tabIndex = tab + 2;
        let websiteName = input[tabIndex];

        switch (websiteName) {
            case 'Facebook':
                salary -= 150;
                break;
            case 'Instagram':
                salary -= 100;
                break;
            case 'Reddit':
                salary -= 50;
                break;
        }
    }
    if (salary <= 0) {
        console.log("You have lost your salary.");


    } else {
        console.log(salary)
    }
}

#include <iostream>
