#include <bits/stdc++.h>
 
using namespace std;
 
int main() {
    int N, M;
    cin >> N >> M;
     
    vector<int> unread(N + 1, 0); 
    int total_unread = 0; 
     
    for (int i = 0; i < M; i++) {
        int sender;
        cin >> sender;
         
        total_unread -= unread[sender];
        unread[sender] = 0;
         

        total_unread += N - 1; 
         
        for (int j = 1; j <= N; j++) {
            if (j != sender) unread[j]++;
        }
         
        cout << total_unread<<endl;
    }
     
    return 0;
}

