using namespace std;

int main() {
    ios::sync_with_stdio(false);
    cin.tie(nullptr);

    int N, M;
    cin >> N >> M;

    unordered_map<int, int> last_sent;
    int unread = 0;

    for (int i = 0; i < M; i++) {
        int sender;
        cin >> sender;

        unread -= last_sent[sender]; 
        last_sent[sender] = unread + 1; 
        unread += N - 1;
        cout << unread << "\n";
    }

    return 0;
}

import java.io.BufferedReader;
import java.io.InputStreamReader;
import java.net.HttpURLConnection;
import java.net.URL;

public class ApiExample {
    public static void main(String[] args) {
        String apiUrl = "https://jsonplaceholder.vivo.com/users"; // URL da API de exemplo

        try {
            // Criando a URL e abrindo a conexão
            URL url = new URL(apiUrl);
            HttpURLConnection connection = (HttpURLConnection) url.openConnection();

            // Configurando o método de requisição
            connection.setRequestMethod("GET");
            connection.setRequestProperty("Accept", "application/json");

            // Verifica se a resposta é 200 (OK)
            int responseCode = connection.getResponseCode();
            if (responseCode == 200) {
                // Lendo a resposta da API
                BufferedReader reader = new BufferedReader(new InputStreamReader(connection.getInputStream()));
                StringBuilder response = new StringBuilder();
                String line;
                
                while ((line = reader.readLine()) != null) {
                    response.append(line);
                }
                reader.close();

                // Exibe os dados da API no console
                System.out.println("Resposta da API:");
                System.out.println(response.toString());
            } else {
                System.out.println("Erro na conexão: Código " + responseCode);
            }

            // Fecha a conexão
            connection.disconnect();
        } catch (Exception e) {
            e.printStackTrace();
        }
    }
}

